function drawHexagon(r,tX,tY,width){
  c.save();
  c.translate(tX,tY);
  var a = r*Math.sin(Math.PI/6);
  var b = r*Math.cos(Math.PI/6);
  c.beginPath();
  c.moveTo(0,r);
  c.lineTo(b,r-a);
  c.lineTo(b,-r+a);
  c.lineTo(0,-r);
  c.lineTo(-b,-r+a);
  c.lineTo(-b,r-a);
  c.lineTo(0,r);
  var rs = r-width;
  var a = rs*Math.sin(Math.PI/6);
  var b = rs*Math.cos(Math.PI/6);
  c.moveTo(0,rs);
  c.lineTo(-b,rs-a);
  c.lineTo(-b,-rs+a);
  c.lineTo(0,-rs);
  c.lineTo(b,-rs+a);
  c.lineTo(b,rs-a);
  c.lineTo(0,rs);
  c.closePath();
  c.fill();
  c.restore();
}
